import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Card, CardHeader, CardTitle, CardContent, Button } from '@/components/ui/card';
import { Search } from 'lucide-react';

function UserHome() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Perform any necessary logout operations here
    alert("Logged out successfully");
    navigate("/");
  };

  return (
    <div className="flex flex-col items-center justify-center h-screen">
      <Card className="w-full max-w-3xl">
        <CardHeader>
          <CardTitle>Welcome to the Educational Resource Library</CardTitle>
        </CardHeader>
        <CardContent>
          <div className="flex flex-col items-center justify-center space-y-6">
            <h1 className="text-4xl font-bold">Hello, User!</h1>
            <p className="text-lg text-gray-600">
              Explore a vast collection of educational materials, including textbooks, research papers, and study guides.
            </p>
            <div className="w-full max-w-md">
              <div className="relative">
                <div className="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
                  <Search className="w-5 h-5 text-gray-400" />
                </div>
                <input
                  type="text"
                  className="w-full px-4 py-2 pl-10 text-gray-900 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                  placeholder="Search the library..."
                />
              </div>
            </div>
            <Button onClick={handleLogout} variant="outline" className="mt-4">
              Logout
            </Button>
          </div>
        </CardContent>
      </Card>
    </div>
  );
}

export default UserHome;
